import React, { useState } from "react";
import TodoForm from "./TodoForm";
const TodoList = () => {
  const [todos, setTodos] = useState([]);

  const addTodo = (todo) => {
    if (todo !== "") {
      setTodos(...todos, todo);
    }
  };

  return (
    <div>
      <TodoForm />
      <ul className="list-group">
        {todos.map((todo) => (
          <li className="list-group-item">An item</li>
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
